import logo from './logo.svg';
import React, { Component } from "react";
import { Route, Link, Switch } from "react-router-dom";
import './App.css';
import UserLogin from './UserLogin';
import CarrierLogin from './CarrierLogin';
import RestaurantLogin from './RestaurantLogin';
import axios from "axios";

class App extends Component {
  constructor(){
    super();
  }

 createUser = async (e) => {
    e.preventDefault();

    let response = await axios.post(
      `http://localhost:3001/api/auth/signup/user`,
      {
        name: e.target.name.value,
        username: e.target.username.value,
        password: e.target.password.value
      }
    );
  }
  render(){
  return (
    <div className="App">
      <h1>DelivApp</h1>
      <header className="App-header">

        <nav>
          <Link to='/api/auth/signup/user'className='li'>USER</Link>
          <Link to='/api/auth/signup/carrier' className='li'>CARRIER</Link>
          <Link to='/api/auth/signup/restaurant' className='li'>RESTAURANT</Link>
        </nav>
      </header>
      <main>
        <Switch>
      <Route path = '/api/auth/signup/user' component={UserLogin}/>
      <Route path = '/api/auth/signup/carrier' component={CarrierLogin}/>
      <Route path = '/api/auth/signup/restaurant' component={RestaurantLogin}/>
      </Switch>
      </main>
    </div>
  );
}
}

export default App;
